import { Link } from "react-router-dom";

function Header(){
    return (
        <>
        
        <Link href="./home">Home</Link> &nbsp;
        <Link href="./about">About</Link> &nbsp;
        <a href="./contact">Contact</a> &nbsp; 
        </>
    );
 }

 export default Header;
